Objective = alpha;
Constraints = [];

for s = 1:N
	for t = 1:N
		if s ~= t
			for n = 1:N
				in_flow = f_st(s,t,:) .* input_c(n,:);
				out_flow = f_st(s,t,:) .* output_c(n,:);

				if n == s
					flow_conservation = (out_flow - in_flow == mu_st(s, t));
				elseif n == t
					flow_conservation = (out_flow - in_flow == -mu_st(s, t));
				else n == t
					flow_conservation = (out_flow - in_flow == 0);
				end

				Constraints = [Constraints, flow_conservation];

			end
		end
	end
end

for e = 1:E
	linear_constraint = sum(f_st(:,:,e)) <= alpha * C2;
	Constraints = [Constraints, linear_constraint];
end

for e = 1:E
	socp_constraint = C1 * norm(sum(f_st(:,:,e) .* sigma_st), 2) <= C2 - sum(f_st(:,:,e) .* mu_st);
	Constraints = [Constraints, socp_constraint];
end

Constraints = [Constraints, f_st(:) >= 0];

sol = optimize(Constraints, Objective);

disp('alpha:');
disp(value(alpha));

